    <div className="topnav" id="myTopnav">
      <Link href="/">
        <a>Jobaho</a>
      </Link>
      <Link href="/jobSection">
        <a>Find a Job</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="#">
        <a class="icon">
          <img src={menuIcon}></img>
        </a>
      </Link>
      <div className="dropdown-content">
        <Link href="/jobSection">
          <a>Find a Job</a>
        </Link>
        <Link href="/about">
          <a>About</a>
        </Link>
        <Link href="/">
          <a>Home</a>
        </Link>
      </div>
    </div>
  );
};

export default Navbar;
